import React, { useState } from "react";
import {
    StyleSheet,
    Text, 
    View, 
    ImageBackground
} from 'react-native';

export default function RegistrationScreen() {
    return (
        <View style={styles.container}>

        </View>
    );

}

const styles = StyleSheet.create({
  container: {
    flex: 1,
        backgroundColor: '#fff',
        maxWidth: 375,
    },
   image: {
       flex: 1,
       resizeMode: 'cover',
       justifyContent: 'center',
    },
});
